webpackJsonp([0x6e1758cf1364],{795:function(n,t){n.exports={data:{post:{id:"/home/paul-ssd/Git_Repositories/paulness.github.io/content/posts/2017-10-24--ubuntu-bash-script-setup-dev-software/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>Get your development environment up and running quickly!</p>\n</blockquote>\n<p>In the post, we will go through an automated bash script, which will turn your fresh Ubuntu install into a fully fledged development machine within no time. This script I have tested on Ubuntu 16.04.3 as of Nov-13-2017. You’ll get a chance to un-check the software that you are not interested in. I’ve included a range of software for you to choose from.</p>\n<p>It is as simple as:</p>\n<ol>\n<li>Download <a href="http://mirrors.bloomu.edu/ubuntu-releases/16.04.3/ubuntu-16.04.3-desktop-amd64.iso">Ubuntu 16.04.3</a> and install it, if you do not already have Ubuntu installed</li>\n<li>Copy the file <a href="https://gist.github.com/paulness/73238d84996cb8fc21aff644218a49a2">post_install.sh</a> to your Ubuntu desktop open a terminal in your desktop and run the below command.</li>\n<li>Open the terminal</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-6a965.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.75105485232068%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Right click and open a terminal in the Desktop folder"\n        title=""\n        src="/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-48538.png"\n        srcset="/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-bed0f.png 200w,\n/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-5fd34.png 400w,\n/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-48538.png 800w,\n/static/ubuntu-running-post-install-script-right-click-to-open-terminal-6fd8100a660a104147275d7d810efc34-6a965.png 1185w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>And run the commands.</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code class="language-bash"><span class="token comment"># ensure the line endings are unix (after downloading from GIT)</span>\n<span class="token function">sudo</span> <span class="token function">sed</span> -i -e <span class="token string">\'s/\\r$//\'</span> post_install.sh\n\n<span class="token comment"># execute the script</span>\n<span class="token function">sudo</span> <span class="token function">chmod</span> +x post_install.sh<span class="token punctuation">;</span> <span class="token function">sudo</span> ./post_install.sh\n</code></pre>\n      </div>\n<p>This is what you’ll see in the terminal, right before you execute the script.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-b70ec.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 63.83333333333333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Terminal just before executing the script"\n        title=""\n        src="/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-48538.png"\n        srcset="/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-bed0f.png 200w,\n/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-5fd34.png 400w,\n/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-48538.png 800w,\n/static/ubuntu-running-post-install-script-fd2314c96bce6f48c87197ec393a6e0f-b70ec.png 1200w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>And once you press enter, you’ll see text streaming down.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-ac231.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.18887015177066%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Script in progress"\n        title=""\n        src="/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-48538.png"\n        srcset="/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-bed0f.png 200w,\n/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-5fd34.png 400w,\n/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-48538.png 800w,\n/static/ubuntu-running-post-install-script-underway-20359217582b2eba26519537ceca2d61-ac231.png 1186w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>You’ll see this prompt window; you may un-check software you do not wish to install. The themes I have unchecked by default since I prefer the default theme in Ubuntu.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-267a4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.38655462184873%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Choosing software to install"\n        title=""\n        src="/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-48538.png"\n        srcset="/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-bed0f.png 200w,\n/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-5fd34.png 400w,\n/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-48538.png 800w,\n/static/ubuntu-running-post-install-script-prompt-2525aaaa80d10f3932f13891d071d028-267a4.png 1190w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After pressing OK to install the software, you’ll see more prompts, type appropriate passwords, accept license agreements, accept certificates and choose the obvious options along the way to ensure all software is installed.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-ac231.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.02023608768971%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Typing MySQL server password"\n        title=""\n        src="/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-48538.png"\n        srcset="/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-bed0f.png 200w,\n/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-5fd34.png 400w,\n/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-48538.png 800w,\n/static/ubuntu-running-post-install-script-prompt-2-ad023302d1e2771afdef69beeae1538e-ac231.png 1186w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>When you have finished, you’ll have a range of software on your computer to help you with development.</p>\n<p>Credits:\n<a href="https://github.com/KingsleyOmon-Edo/">Original bash script credit to KingsleyOmon-Edo</a></p>',fields:{slug:"/ubuntu-bash-script-setup-dev-software/",prefix:"2017-10-24"},frontmatter:{title:"Ubuntu 16.04.3 (x64) bash script for developers after a fresh install",subTitle:"I've put together a bash script with some awesome tools and software that I use daily. This script will install a huge range of development and productivity software from VirtualBox, Visual Studio Extensions to DupeGuru on Ubuntu.",cover:{childImageSharp:{resize:{src:"/static/ubuntu-logo-76dfc91ab7fc328d37bbde66293c5b8b-ada8c.jpg"}}}}},author:{id:"/home/paul-ssd/Git_Repositories/paulness.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>Paul S. Ness</strong> Software engineer with seven years of experience in a variety of industries such travel, payments, medical and publishing.</p>"},footnote:{id:"/home/paul-ssd/Git_Repositories/paulness.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:""},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/ubuntu-bash-script-setup-dev-software/"}}}});
